import '../App.min.css';
import { Box, Drawer, List, ListItem, ListItemButton, ListItemIcon, Link, Toolbar, Divider, ListItemText } from '@mui/material';
import InboxIcon from '@mui/icons-material/MoveToInbox';
import MailIcon from '@mui/icons-material/Mail';
import SettingsIcon from '@mui/icons-material/Settings'

const drawerWidth = 75;
const drawerWidth1 = 250;

function Settings() {
  return (
    <Box className="container">
      <Drawer
        PaperProps={{
          sx: {
            backgroundColor: '#0f72bd',
            flexDirection: 'column',
            justifyContent: 'space-between',
          }
        }}
        sx={{
          width: drawerWidth,
          height: '100%',
          flexShrink: 0,
          '& .MuiDrawer-paper': {
            width: drawerWidth,
            boxSizing: 'border-box',
          },
        }}
        variant="permanent"
        anchor="left"
      >
        <Box className="navbar-top">
          <Box className='navbar-header'>
            <Link className="navbar-logo" href="/">
              <img src={require("../images/logo.png")} alt="Logo"/>
            </Link>
          </Box>
          <List disablePadding>
            {['Site Selector', 'Plan', 'Manage', 'Report'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton sx={{height: 70, borderBottom: '1px solid #0161aa',}}>
                  <ListItemIcon sx={{paddingLeft: '10px'}}>
                    {index % 2 === 0 ? <InboxIcon sx={{color: 'white'}}/> : <MailIcon sx={{color: 'white'}}/>}
                  </ListItemIcon>
                </ListItemButton>
              </ListItem>
            ))}
          </List>
        </Box>
        <Box className="navbar-bottom">
          <List disablePadding>
              {['Settings'].map((text, index) => (
                <ListItem key={text} disablePadding>
                  <ListItemButton sx={{height: 70, borderTop: '1px solid #0161aa',}} onClick={() => alert('Settings is Pressed')}>
                    <ListItemIcon sx={{paddingLeft: '10px'}}>
                      <SettingsIcon sx={{color: 'white'}}/>
                    </ListItemIcon>
                  </ListItemButton>
                </ListItem>
              ))}
            </List>
        </Box>
      </Drawer>
      <Box className="settings-wrap">
        <Drawer
          PaperProps={{
            sx: {
              position: "absolute",
              marginLeft: '70px',
              backgroundColor: '#252529',
            }
          }}
          sx={{
            width: drawerWidth1,
            flexShrink: 0,
            '& .MuiDrawer-paper': {
              width: drawerWidth1,
              boxSizing: 'border-box',
            },
          }}
          variant="permanent"
          anchor="left"
        >
          <Divider />
          <Toolbar/>
          <List disablePadding>
            {['Site', 'Modules'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemText primary={text} sx={{color: 'white', marginLeft: '20px'}} />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <List disablePadding>
            {['People', 'Companies'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemText primary={text} sx={{color: 'white', marginLeft: '20px'}}/>
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <List disablePadding>
            {['Task', 'Milestones'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemText primary={text} sx={{color: 'white', marginLeft: '20px'}}/>
                </ListItemButton>
              </ListItem>
            ))}
          </List>
          <Divider />
          <List
            sx={{
              '& .MuiListItemButton-root:hover': {
                bgcolor: 'orange',
                '&, & .MuiListItemText-root': {
                  color: 'yellow',
                },
              },
            }}
            disablePadding
          >
            {['Tower Cranes', 'Mobile Cranes', 'Hoists', 'Delivery Bays', 'Loading Platforms', 'Material Handling', 'Concrete Pumps'].map((text, index) => (
              <ListItem key={text} disablePadding>
                <ListItemButton>
                  <ListItemText 
                    primary={text} 
                    sx={{
                      color: 'white', 
                      marginLeft: '20px'
                    }}
                  />
                </ListItemButton>
              </ListItem>
            ))}
          </List>
        </Drawer>
      </Box>
    </Box>
  );
}

export default Settings;
